"""1. Neural Network with Single Neuron"""

#1 Def of Sigmoid Fun
#S= 1/1+(e^-x)
def sigmoid (x):
  s = 1/(1+np.exp(-x))
  return s

#2 Initalize Weights and Bias
w = np.random.rand(1,num_pixels) * 0.01
#print(w.shape)
  #Bias
b = np.zeros((1,1))
  
#print(b)

"""![image.png](data:image/png;base64,)"""

# loss function - cross entropy (Refer formula above)
def compute_loss(y,y_pred):
  m=y.shape[1]
  loss = -1*(1./m)*(np.sum(np.multiply(np.log(y_pred),y)) + np.sum(np.multiply(np.log(1-y_pred),1-y)))
  return loss

#Defining model
def single_model(X,w,b):
  # z=wx+b
  z = np.matmul(w,X)+b
  y_pred = sigmoid(z)
  return y_pred

'''
eta is the learning rate
W0 <- W0 - eta*dl/dW0
W1 <- W1 - eta*dl/dW1
.........
Wn <- Wn - eta*dl/dWn
'''

#Backpropagation function
def back_propagate(X,y,learning_rate,w,b):
  
  
  y_pred=single_model(X,w,b)
  
  # Compute the loss 
  loss = compute_loss(y,y_pred)  

  # dw = (1/m)*X(A-Y).T
  dw = (1./m) * np.matmul((y_pred-y),X.T)
  #print(dw)

  #db = (1/m)*sum(A-Y)
  db = (1./m) * np.sum(y_pred-y,axis=1,keepdims=True)
  #print(db)

  w = w - learning_rate*dw
  b = b - learning_rate*db

  return w,b,loss

# Training Model
batch_size=1000
learning_rate=0.1
def train_model_single(X,y,w,b):
  losses=[]
  print(f'Training loss for model')
  for i in range(0,m,batch_size):
    X_data=X[:,i:i+batch_size]
    y_data=y[:,i:i+batch_size]
    w,b,loss=back_propagate(X_data,y_data,learning_rate,w,b)
    if(i==0):
      print(f'Epoch {i+1}:', round(loss,4))
    else:
      print(f'Epoch {i/batch_size+1}:',round(loss,4))
    losses.append(loss)
  return losses,w,b

