#1. Initalize Weights and Bias
def init_weight(batch_size,nneuron,out_layer):
  w1 = np.random.rand(num_pixels,nneuron) * 0.01 #- 0.5
  w2 = np.random.rand(nneuron,out_layer) * 0.01
  #print(w1.shape)
  #print(w2.shape)
  return w1,w2
  #Bias
b = np.zeros((1,1))
  #b2 = np.zeros((1,1))

def model(X,w1,w2,b):
  #print('X shape',X.shape) # (784, 1000)
  
  #print('w1 shape',w1.shape) # (784, 64)
  #print('w2 shape',w2.shape) # (64,1)

  z1 = np.matmul(w1.T,X)+b #input layer. 
  #z1 = w1.T.dot(X)+b
  o1 = sigmoid(z1) #input to hidden layer #(64,1000)
  #print('z1 shape',z1.shape) # (64, 1000)
  #print('o1 shape',o1.shape) # (64, 1000)
  
  z2=np.matmul(w2.T,o1)+b #Hidden layer
  #print('z2 shape',z2.shape) # (1, 1000)

  y_pred=sigmoid(z2) #output layer
  
    #y_pred=softmax(z2)
  
  #print('y_pred shape',y_pred.shape) # (1,1000)
  #print(y_pred)
  
  return y_pred,o1

y_prediction=np.zeros(y_train.shape)
def back_propagation(X,y,learning_rate,w1,w2,b):
  
  y_pred,o1=model(X,w1,w2,b)
  np.append(y_prediction,y_pred)

  # Compute the loss 
  loss = compute_loss(y,y_pred)  # cross-entropy function
  #print('y_pred',y_pred.shape)
  #print('loss',loss.shape)
  #print('y shape',y.shape)
  
  e2 = (y_pred-y) #error in output layer #  1,1000
  e1= np.multiply((np.matmul(w2,e2)),np.multiply(o1,1-o1)) #d1

  dw2 = (1./m) * np.matmul(e2,o1.T)
  dw1 = (1./m) * np.matmul(e1,X.T)

  #print('dw1 shape',dw1.shape)
  #print('dw2 shape',dw2.shape)

  db = (1./m) * np.sum(y_pred-y,axis=1,keepdims=True)


  w1 = w1 - learning_rate*dw1.T
  w2 = w2 - learning_rate*dw2.T
  
  b = b - learning_rate*db

  return w1,w2,b,loss

# Training Model
batch_size=1000
learning_rate=0.1
